(87, 19, 'blogs', 'Basic Typescript', '<div><b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; Basic Typescript</b></div><div><b><br></b></div><div>&nbsp;Typescript is an object oriented programming language that build on top of JS with extra feature</div><div>&nbsp; &nbsp;when working in a large scale application with js we face some problem like&nbsp;</div><div>&nbsp; &nbsp; &nbsp;- very difficult to manage large codebase</div><div>&nbsp; &nbsp; &nbsp;- Hard to find bugs</div><div>&nbsp; &nbsp; &nbsp;- Catch error only in runtime&nbsp;</div><div><br></div><div>&nbsp;- Interesting --&gt; typescript code can be transplied into older versions of javascript. We can give instraction for it.&nbsp;</div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Browser can not read typescript code.It convert to js and then run in browser or node js env</div><div>&nbsp;&nbsp;</div><div>&nbsp;&nbsp;</div><div>&nbsp; Benifits of using typescript</div><div>&nbsp; &nbsp;- Support older browser</div><div>&nbsp; &nbsp;- type safety</div><div>&nbsp; &nbsp;- Increase productivity</div><div>&nbsp; &nbsp;- Less bugs and less testing</div><div>&nbsp; &nbsp;- object with custom types</div>', 'image/page/1796383120544165.png', NULL, NULL),
